import { makeStyles } from '@material-ui/core/styles';
import Icon from "@material-ui/core/Icon";

const Navigation = () => {
  return (
    <div>
      <p>Hola</p>
      <Icon className="fas fa-heart" />
    </div>
  );
};
export default Navigation;
